\u201eCzy kto\u015b jeszcze czyta blogi?\u201d. Kilka lat temu by\u0142o to bardzo popularne, wielu youtuber\u00f3w od tego zaczyna\u0142o swoj\u0105 karier\u0119. Teraz zdecydowana wi\u0119kszo\u015b\u0107 z nas wybiera instagrama, mo\u017cna zauwa\u017cy\u0107 pojawianie si\u0119 coraz wi\u0119kszej ilo\u015bci takowych blog\u00f3w osobistych na tej platformie.  Dlatego aby dotrze\u0107 z moimi przemy\u015bleniami do chocia\u017c kilku os\u00f3b wybra\u0142am instagrama. Instagram cieszy si\u0119 du\u017c\u0105 popularno\u015bci\u0105 z powodu naszego ci\u0105g\u0142ego po\u015bpiechu, szybkiego trybu \u017cycia oraz z zaprogramowania m\u00f3zgu na odczyt informacji z obrazk\u00f3w, my\u015bl\u0119, \u017ce ok. 90% os\u00f3b nie czyta opis\u00f3w pod zdj\u0119ciami, tylko przesuwa palcem i ogl\u0105da fotografie daj\u0105c serduszka pod tymi kt\u00f3re mu si\u0119 spodobaj\u0105, zwr\u00f3c\u0105 uwag\u0119 albo nawet w niekt\u00f3rych przypadkach \u201ez automatu\u201e. Takie zachowanie bardzo u\u0142atwia manipulacj\u0119 stosowan\u0105 przez tw\u00f3rc\u00f3w ale ten temat pozostawi\u0119 na inny wpis. Nie licz\u0119 na za du\u017c\u0105 publik\u0119, nie zobaczycie tu wyj\u0105tkowych zdj\u0119\u0107, b\u0119dzie to troch\u0119 m\u00f3j pami\u0119tnik, b\u0119d\u0119 pisa\u0107 co my\u015bl\u0119 i nie chc\u0119 (przynajmniej na razie) ujawnia\u0107 mojej osoby. \nZatem bardzo si\u0119 ciesz\u0119 je\u017celi to czytasz i dzi\u0119kuj\u0119 za po\u015bwi\u0119cenie czasu. Mam  nadziej\u0119, \u017ce zostaniesz na d\u0142u\u017cej \u003c3  Gabriela \n#instablog #instabloger #thoughts \n#meet #me #life #blog"}}]},"shortcode":"B9xJJnYAaOF","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584304442,"dimensions":{"height":750,"width":750},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/90231355_104657274415855_4036947069983195107_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=A5tx774D8JoAX_eEoJq\u0026o 8900635482_1785482995877374975_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=SYgLyRXvD0gAX_i8zEa\u0026oh=b0c7585c52d592e6c6da634418d18adb\u0026oe=5EA4C5BF","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"\u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a\u4e00\u4eba\u6216\u591a\u4eba\u3001\u4e0a\u9762\u7684\u6587\u5b57\u662f\u201cgoodbyes hurt. it brings something out ofus that feels like a curse. that pain in your chest that won 't go away. all you hear is \"you will be ok\" but deep down thats not what you want to hear. all you want is that person to stay. and to never go away.\u201d"}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2265632304267516999","edge_media_to_caption":{"edges":[{"node":{"text":"\u015awiat zwolni\u0142. W tej ca\u0142ej dramaturgii doszukuje si\u0119 plus\u00f3w, cho\u0107 wewn\u0119trznie odczuwam niepok\u00f3j i niesamowity strach o przysz\u0142o\u015b\u0107. \ud83d\ude48Pozwol\u0119 sobie zaspamowa\u0107 troch\u0119 instagrama i wywali\u0107 swoje refleksje. Uznaje to za antidotum na zaistnia\u0142\u0105 sytuacj\u0119. Przez ostanie miesi\u0105ce \u017cy\u0142am w takim po\u015bpiechu, \u017ce momentami zapomina\u0142am jak si\u0119 nazywam. Polubi\u0142am ten styl \u017cycia, cho\u0107 nie ukrywam, \u017ce siedzenie w domu sprawia mi ogromn\u0105 rado\u015b\u0107... Po\u015bwi\u0119cam czas na czytanie ksi\u0105\u017cek, by m\u00f3c z wi\u0119kszym impetem ry\u0107 psych\u0119 swoim bliskim \ud83d\ude01\ud83d\udc96\ud83d\udc96 #ilovemypeople\u2764\ufe0f\ud83d\udc9b\ud83d\udc9a Aktywno\u015b\u0107 fizyczna r\u00f3wnie\u017c utrzymana jest na odpowiednim poziomie \ud83c\udfcb\ufe0f\u200d\u2640\ufe0f i mog\u0119 bez po\u015bpiechu przyrz\u0105dza\u0107 swoje fit \"kupy\" w kuchni. \ud83e\udd63\nZalecam Wszystkim, by przeznaczyli ten czas na realizacj\u0119 siebie.\nWszystko b\u0119dzie dobrze. Musi by\u0107 \u2764\ufe0f\n______________________\n\"Odkry\u0142am, \u017ce zawsze mam wyb\u00f3r. Czasem jest to po prostu wyb\u00f3r odpowiedniego podej\u015bcia do \u017cycia.\"\n#word #life #time #psychology #rozw\u00f3josobisty #rozwoj  #girl #girlpower #brunette #learn #study"}}]},"shortcode":"B9xJJOvg9xH","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584304439,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/90020828_666018244215809_3181592054796644681_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=a1ETGiogINoAX-QFGaq\u0026oh=677db3e54a27b136f922f17369394ffb\u0026oe=5EA41612","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"8032673201"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/90020828_666018244215809_3181592054796644681_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=a1ETGiogINoAX-QFGaq\u0026oh=391bd9337407945417fd675cf9492889\u0026oe=5EA599F7","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/90020828_666018244215809_3181592054796644681_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=a1ETGiogINoAX-QFGaq\u0026oh=12a71945ec478408e11d7ba84a99c6f7\u0026oe=5EA74A50","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/90020828_666018244215809_3181592054796644681_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=a1ETGiogINoAX-QFGaq\u0026oh=38d70900c059017fab03f6a1cacaf54d\u0026oe=5E9E031A","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/90020828_666018244215809_3181592054796644681_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=a1ETGiogINoAX-QFGaq\u0026oh=11598bf2f015a049732b4b25090df447\u0026oe=5E9C50A0","config_width":320,"config_height":320},{"src":"https:
